const formbarButton = {
    backgroundColor: "beige",
    border: "none",
    borderRadius: "10px",
    color: "black",
    fontWeight: "700",
    height: "40px",
    width: "80px",
}

import '../App.css';

const Button = ({clickAddButtonHandler, children}) => {
    return <button className='formbar_button' onClick={clickAddButtonHandler}>{children}</button>
};

export default Button;
